DECLARE\n  locations JUMPTO.t_locations;\n  rec your_table%ROWTYPE; -- Replace 'your_table' with the actual table name\nBEGIN\n  JUMPTO.procGetLocations(locations);\n  \n  -- Fetch and display the rows\n  LOOP\n    FETCH locations INTO rec;\n    EXIT WHEN locations%NOTFOUND;\n    DBMS_OUTPUT.PUT_LINE('Column1: ' || rec.column1 || ', Column2: ' || rec.column2); -- Replace 'column1', 'column2' with actual column names from your table\n  END LOOP;\n  CLOSE locations;\nEND;\n/